import React from 'react';

const BotCard = ({ bot, onEnlist, deleteBot}) => {
  const { id, name, health, damage, armor, bot_class, catchphrase, avatar_url } = bot;

  function deleteBot(bot, removeFromArmy) {
    fetch(`http://localhost:8001/bots/${bot.id}`, {
    method: "DELETE",
    headers: {
    "Content-Type": "application/json",
    },
    // body: JSON.stringify(bot),
    // }).then(() => {
    // removeFromArmy(bot);
    // });
    }
    );
    };
  return (
    <div className="bot-card">
      <div className="bot-card-header" onClick={() => onEnlist(bot)}>
        <img src={avatar_url} alt={name} />
        <h3>{name}</h3>
      </div>
      <div className="bot-card-details">
        <p>Health: {health}</p>
        <p>Damage: {damage}</p>
        <p>Armor: {armor}</p>
        <p>Class: {bot_class}</p>
        <p>Catchphrase: {catchphrase}</p>
      </div>
      <button deleteBot={()=> deleteBot(bot)}>Discharge</button>
    </div>
  );
}

export default BotCard;
